import React from 'react';
import './App.css';
import Main from './Main';
import Apple from './Apple';
import Orange from './Orange';
import Banana from './Banana';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className='App'>
        <Main />
        <Apple />
        <Orange />
        <Banana />
      </div>
    </Router>
  );
}

export default App;
